    var parseMidiFile = function(fileName, channel, flag) {
            //reset absolute time for each track
            var absoluteTime = 0;
            var patternNameToStart = fileName;
            fileName = fileName.split('__')[0];
            function readChunk(stream) {
                absoluteTime = 0;
                var id = stream.readTo(4);
                var length = stream.read32BitInt();
                return {
                    id: id,
                    length: length,
                    data: stream.readTo(length)
                };
            }

            var lastEventType;

            function readEvent(stream) {
                var event = {};
                event.absoluteTime = (absoluteTime += stream.readVariableLengthInt());
                var eventTypeByte = stream.read8BitInt();
                if ((eventTypeByte & 0xf0) == 0xf0) { /* system / meta event */
                    if (eventTypeByte == 0xff) { /* meta event */
                        event.type = 'meta';
                        var subtypeByte = stream.read8BitInt();
                        var length = stream.readVariableLengthInt();
                        switch (subtypeByte) {
                        case 0x00:
                            event.subtype = 'sequenceNumber';
                            if (length != 2) return;
                            event.number = stream.read16BitInt();
                            return event;
                        case 0x01:
                            event.subtype = 'text';
                            event.text = stream.readTo(length);
                            return event;
                        case 0x02:
                            event.subtype = 'copyrightNotice';
                            event.text = stream.readTo(length);
                            return event;
                        case 0x03:
                            event.subtype = 'trackName';
                            event.text = stream.readTo(length);
                            return event;
                        case 0x04:
                            event.subtype = 'instrumentName';
                            event.text = stream.readTo(length);
                            return event;
                        case 0x05:
                            event.subtype = 'lyrics';
                            event.text = stream.readTo(length);
                            return event;
                        case 0x06:
                            event.subtype = 'marker';
                            event.text = stream.readTo(length);
                            return event;
                        case 0x07:
                            event.subtype = 'cuePoint';
                            event.text = stream.readTo(length);
                            return event;
                        case 0x20:
                            event.subtype = 'midiChannelPrefix';
                            if (length != 1) return;
                            event.channel = stream.read8BitInt();
                            return event;
                        case 0x2f:
                            event.subtype = 'endOfTrack';
                            if (length != 0) return;
                            return event;
                        case 0x51:
                            event.subtype = 'setTempo';
                            if (length != 3) return;
                            event.microsecondsPerBeat = (
                            (stream.read8BitInt() << 16) + (stream.read8BitInt() << 8) + stream.read8BitInt())
                            return event;
                        case 0x54:
                            event.subtype = 'smpteOffset';
                            if (length != 5) return;
                            var hourByte = stream.read8BitInt();
                            event.frameRate = { 0x00: 24, 0x20: 25, 0x40: 29, 0x60: 30}[hourByte & 0x60];
                            event.hour = hourByte & 0x1f;
                            event.min = stream.read8BitInt();
                            event.sec = stream.read8BitInt();
                            event.frame = stream.read8BitInt();
                            event.subframe = stream.read8BitInt();
                            return event;
                        case 0x58:
                            event.subtype = 'timeSignature';
                            if (length != 4) return;
                            event.numerator = stream.read8BitInt();
                            event.denominator = Math.pow(2, stream.read8BitInt());
                            event.metronome = stream.read8BitInt();
                            event.thirtyseconds = stream.read8BitInt();
                            return event;
                        case 0x59:
                            event.subtype = 'keySignature';
                            if (length != 2) return;
                            event.key = stream.read8BitInt();
                            event.scale = stream.read8BitInt();
                            return event;
                        case 0x7f:
                            event.subtype = 'sequencerSpecific';
                            event.data = stream.readTo(length);
                            return event;
                        default:
                            event.subtype = 'unknown';
                            event.data = stream.readTo(length);
                            return event;
                        }
                        event.data = stream.readTo(length);
                        return event;
                    } else if (eventTypeByte == 0xf0) {
                        event.type = 'sysEx';
                        var length = stream.readVariableLengthInt();
                        event.data = stream.readTo(length);
                        return event;
                    } else if (eventTypeByte == 0xf7) {
                        event.type = 'dividedSysEx';
                        var length = stream.readVariableLengthInt();
                        event.data = stream.readTo(length);
                        return event;
                    } else {
                        event.type = 'unknown';
                        var length = stream.readVariableLengthInt();
                        event.data = stream.readTo(length);
                        DMAF.error('unknown MIDI event type byte of length' + length);
                    }
                } else { /* channel event */
                    var param1;
                    if ((eventTypeByte & 0x80) == 0) {
                        param1 = eventTypeByte;
                        eventTypeByte = lastEventType;
                    } else {
                        param1 = stream.read8BitInt();
                        lastEventType = eventTypeByte;
                    }
                    var eventType = eventTypeByte >> 4;
                    event.channel = eventTypeByte & 0x0f;
                    event.type = 'channel';
                    switch (eventType) {
                    case 0x08:
                        event.subtype = 'noteOff';
                        event.midiNote = param1;
                        event.velocity = stream.read8BitInt();
                        return event;
                    case 0x09:
                        event.midiNote = param1;
                        event.velocity = stream.read8BitInt();
                        if (event.velocity == 0) {
                            event.subtype = 'noteOff';
                        } else {
                            event.subtype = 'noteOn';
                        }
                        return event;
                    case 0x0a:
                        event.subtype = 'noteAftertouch';
                        event.midiNote = param1;
                        event.amount = stream.read8BitInt();
                        return event;
                    case 0x0b:
                        event.subtype = 'controller';
                        event.controllerType = param1;
                        event.value = stream.read8BitInt();
                        return event;
                    case 0x0c:
                        event.subtype = 'programChange';
                        event.programNumber = param1;
                        return event;
                    case 0x0d:
                        event.subtype = 'channelAftertouch';
                        event.amount = param1;
                        return event;
                    case 0x0e:
                        event.subtype = 'pitchBend';
                        event.value = param1 + (stream.read8BitInt() << 7);
                        return event;
                    default:
                        event.subtype = 'unknown';
                        DMAF.error('Unrecognised MIDI event type: ' + eventType);
                    }
                }
            }
            var xhr = new XMLHttpRequest();
            xhr.open('GET', DMAF.midiPath + fileName + '.mid', true);
            xhr.overrideMimeType('text/plain; charset=x-user-defined');
            //xhr.responseType = 'arraybuffer';
            xhr.onload = function(e) {
                if (e.target.status !== 200) {
                    return;
                }

                var response = e.target.response || '';
                var result = [];
                var length = response.length;
                var charCode = String.fromCharCode;
                for (var z = 0; z < length; z++) {
                    result[z] = charCode(response.charCodeAt(z) & 255);
                }
                var data = result.join('');
                stream = midistream(data);
                var headerChunk = readChunk(stream);
                if (headerChunk.id != 'MThd' || headerChunk.length != 6) {
                    DMAF.error('Found no header in midi file..');
                    return;
                }
                var headerStream = midistream(headerChunk.data);
                var formatType = headerStream.read16BitInt();
                var trackCount = headerStream.read16BitInt();
                var timeDivision = headerStream.read16BitInt();

                if (timeDivision & 0x8000) {
                    ticksPerBeat = 480;
                    DMAF.error('Time division in SMPTE, defaulting to 480 ticks per beat');
                } else {
                    ticksPerBeat = timeDivision;
                }

                var header = {
                    formatType: formatType,
                    trackCount: trackCount,
                    ticksPerBeat: ticksPerBeat
                };
                var tracks = [];
                for (var i = 0; i < header.trackCount; i++) {
                    tracks[i] = [];
                    var trackChunk = readChunk(stream);
                    if (trackChunk.id != 'MTrk') {
                        DMAF.error('Expected MTrk but I got ' + trackChunk.id);
                        return;
                    }
                    var trackStream = midistream(trackChunk.data);
                    while (!trackStream.endOfFile()) {
                        var event = readEvent(trackStream);
                        tracks[i].push(event);
                    }
                }
                //Create DMAF pattern
                var numberOfTracks = header.trackCount;
                var ticksPerBeat = header.ticksPerBeat;
                //skip track 1 (only meta)
                for (var k = 1; k < numberOfTracks; k++) {
                    var patternArray = tracks[k];
                    var patternToCreate = patternArray[0].text;

                    //check if we can skip it
                    if(parsedPatterns[patternToCreate] !== undefined){
                      //  console.log('pattern already exist!!', patternName, parsedPatterns);
                        continue;
                    }

                    var patternTrigger = patternArray[1].text;

                    var pattern = new DMAF.Processors.BeatPattern(patternToCreate, new DMAF.Processors.BeatPosition(1, 1), new DMAF.Processors.BeatPosition(9, 1));
                    for (var j = 2; j < patternArray.length; j++) {
                        if (patternArray[j].subtype === 'noteOn') {
                            var theEvent = patternArray[j];
                            var totalBeats = theEvent.absoluteTime / ticksPerBeat;
                            var bar = Math.floor(totalBeats / 4) + 1;
                            var beat = parseInt(totalBeats % 4, 10) + 1;
                            var tick = ((totalBeats % 4) * ticksPerBeat) % ticksPerBeat;
                            var endTime;
                            for (var l = j; l < patternArray.length; l++) {
                                if (patternArray[l].subtype === 'noteOff' && patternArray[l].midiNote === theEvent.midiNote || patternArray[l].subtype === 'noteOn' && patternArray[l].velocity === 0 && patternArray[l].midiNote === theEvent.midiNote) {
                                    endTime = patternArray[l].absoluteTime - theEvent.absoluteTime;
                                    break;
                                }
                            }

                            pattern.addEvent(patternTrigger, new DMAF.Processors.BeatPosition(bar, beat, 4, tick + 1), {
                                n: theEvent.midiNote,
                                v: theEvent.velocity,
                                t: theEvent.subtype,
                                e: endTime,
                                c: theEvent.channel
                            });
                        }
                    }
                    parsedPatterns[patternToCreate] = pattern;
                }

                if(flag){
                    if(flag === 'instantMasterStructure'){
                        DMAF.Processors.getMusicController().proceedAddInstantStructure(parsedPatterns[patternNameToStart], channel);
                    } else if(flag === 'masterStructure'){
                        DMAF.Processors.getMusicController().proceedAddStructure(parsedPatterns.empty_pattern, parsedPatterns[patternNameToStart], channel);
                    } else if(flag === 'newStructure'){
                        DMAF.Processors.getMusicController().proceedAddPatternNewStructure(parsedPatterns.empty_pattern, parsedPatterns[patternNameToStart], channel);
                    }
                } else {
                    DMAF.Processors.getMusicController().proceedAddPattern(parsedPatterns[patternNameToStart], channel);
                }
            };
            xhr.send(null);
        };

    var midistream = function(midiString) {
            var pointer = 0;

            function read32BitInt() {
                var result = ((midiString.charCodeAt(pointer) << 24) + (midiString.charCodeAt(pointer + 1) << 16) + (midiString.charCodeAt(pointer + 2) << 8) + midiString.charCodeAt(pointer + 3));
                pointer += 4;
                return result;
            }

            function read16BitInt() {
                var result = ((midiString.charCodeAt(pointer) << 8) + midiString.charCodeAt(pointer + 1));
                pointer += 2;
                return result;
            }

            function read8BitInt() {
                var result = midiString.charCodeAt(pointer);
                pointer += 1;
                return result;
            }

            function readTo(pos) {
                var result = midiString.substr(pointer, pos);
                pointer += pos;
                return result;
            }

            function endOfFile() {
                return pointer >= midiString.length;
            }

            function readVariableLengthInt() {
                var returnInt = 0;
                while (true) {
                    var byten = read8BitInt();
                    if (byten & 0x80) {
                        returnInt += (byten & 0x7f);
                        returnInt <<= 7;
                    } else {
                        return returnInt + byten;
                    }
                }
            }

            return {
                endOfFile: endOfFile,
                readTo: readTo,
                read32BitInt: read32BitInt,
                read16BitInt: read16BitInt,
                read8BitInt: read8BitInt,
                readVariableLengthInt: readVariableLengthInt
            };
        };

